  return (
    <header className="container">
      <div className="px-4 py-6">
        <h1 className="text-2xl md:text-3xl font-bold text-center"><i className="material-icons" style={{fontSize:"2.5rem",margin:"0 0 0 0"}}>&#xe8e5;</i>{title}</h1>
      </div>
    </header>
  );
}
